const cars = [
    {
      id:1,
      brand: 'Chevrolet',
      model: 'monza',
      color: 'red',
      year: 2019,
      price: '$180,680 mil pesos',
      photo: '<img src="data:image/jpeg;base64," width= 150px height= 100px>'
      
    },
    {
      id:2,
      brand: 'Nissan ',
      model: 'versa',
      color: 'Blue',
      year: 2017,
      price: '$170,500 mil pesos',
      photo: '<img src="data:image/jpeg;base64," width= 150px height= 100px>'
    },
  ];
  
  function printCars() {
    //1)Obtener el elemento donde quiero poner los carros
    // 2)Generar el HTML de los carros
    // 3)Poner el HTML en el elemento obtenido
    const container = document.getElementById('container-users');
    let html = '';
    cars.forEach((car) => {
      html += ` <tr>
                  <td>${car.brand}</td>
                  <td>${car.model}</td>
                  <td>${car.color}</td>
                  <td>${car.year}</td>
                  <td>${car.price}</td>
                  <td>${car.photo}</td>
                  <td>
                    <button onclick="deleteCar(${car.id})" 
                    class="btn btn-outline-danger">
                    Delete
                    </button>
                  </td>
                </tr>`;
    });
    container.innerHTML = html;
  }
  function deleteCar(id) {
  
  
    const index = cars.findIndex((car) => car.id == id )
    cars.splice(index,1);
    printCars();
  }
  
  function addCars() {
   
    const brand = document.getElementById('brand').value;
    const model = document.getElementById('model').value;
    const color = document.getElementById('color').value;
    const year = document.getElementById('year').value;
    const price = document.getElementById('price').value;
    const id = cars [cars.length - 1].id + 1;
  
    const newCar = {
      brand: brand,
      
      model,
      color,
      year,
      price,
      id
    }
    cars.push(newCar);
    printCars();
  
    document.getElementById('form-cars').reset();
  }
  
  printCars();
  